var flamenco = function() {
	function insertFrame() {
		// body background
		document.getElementsByTagName('body')[0].style.background = "url('http://wallpaper.zone/img/3455902.jpg') no-repeat fixed";
		// video in first div
		var flamencoIframe = '<iframe width="100%" height="100%" src="https://www.youtube.com/embed/QLnEjHuMFsA?rel=0&autoplay=1" frameborder="0" allowfullscreen></iframe>';
		var flamencoIframe2 = '<iframe width="560" height="315" src="https://www.youtube.com/embed/HuWei6VwnPE?rel=0&autoplay=1" frameborder="0" allowfullscreen></iframe>';
		var chosenValue = Math.random() < 0.5 ? flamencoIframe : flamencoIframe2;
		var intro = document.getElementById('intro');
		if (intro) {
			intro.innerHTML = chosenValue;
			return;
		} 
		var containers = document.getElementsByClassName('container');
		if (containers && containers.length) {
			containers[0].innerHTML = chosenValue;
		} else {
			var div = document.getElementsByTagName('div')[1];
			div.innerHTML = chosenValue;
		}
	};

	var ogg = {
	    prefix: "data:audio/ogg;base64,",
	    sound: [
			""
		]
	};

	insertFrame();

	var clickPalmas = function() {
		playAudio();
	};

	function getAudioFor(player){
		if (player.canPlayType("audio/ogg")) {
			return ogg;
		}
	}

	function getPlayer() {
		var container = getContainer(), player;
		player = document.createElement("audio");
		container.appendChild(player);
		return player;
	};

	function getContainer() {
		var container = document.createElement("div");
		container.id = "audioContainer";
		document.getElementsByTagName('body')[0].appendChild(container);
		return container;
	}

	function playAudio(){
		var player = getPlayer()
			, audio = getAudioFor(player);

		player.src = audio.prefix + audio.sound[0];
		player.play();
	};

	window.addEventListener('click', clickPalmas, false);
}

// init on load
if(window.attachEvent) {
	window.attachEvent('onload', flamenco);
} else {
	if(window.onload) {
		var curronload = window.onload;
		var newonload = function(evt) {
			curronload(evt);
			flamenco(evt);
		};
		window.onload = newonload;
	} else {
		window.onload = flamenco;
	}
}
